import React from 'react';
import './intro.css';
import bg from '../pic/p.jpg';  

const Intro = () => {
  return (
    <section id="intro">
      <div className='introcontent'>
        <h3>Hello</h3>
        <h2 className='introname'>I'M Pranesh Katariya</h2>
        <h2>Web Developer</h2>
        <p className='intropara'>I am skilled and a passionate web Developer</p>
      </div>
      <img src={bg} alt='p' className='bg' />
    </section>
  );
}

export default Intro;
